var app = angular.module("shop", ['ngRoute', 'ngMap'])

app.config(function($routeProvider) {
    $routeProvider
        .when("/", {
            templateUrl: "partial/main.html",
            controller: "MainCtrl"
        })
        .when("/Main", {
            templateUrl: "partial/main.html",
            controller: "MainCtrl"
        })
        .when("/", {
            templateUrl: "partial/mainAuthentificated.html",
            controller: "MainAuthCtrl"
        })
        .when('/Category', {
            templateUrl: 'partial/Category.html',
            controller: 'CategoryCtrl'
        })
        .when('/Category/:category', {
            templateUrl: 'partial/Category.html',
            controller: 'CategoryCtrl'
        })
        .when('/Products', {
            templateUrl: 'partial/Products.html',
            controller: 'ProductsCtrl'
        })
        .when('/ProductDetails', {
            templateUrl: 'partial/ProductDetails.html',
            controller: 'ProductDetailsCtrl'
        })
        .when('/Login', {
            templateUrl: 'partial/Login.html',
            controller: 'LoginCtrl'
        })
        .when("/Login/:errorParam", {
            templateUrl: "partial/main.html",
            controller: "MainCtrl"
        })
        .when('/Register', {
            templateUrl: 'partial/Register.html',
            controller: 'RegisterCtrl'
        })
        .when('/Basket', {
            templateUrl: 'partial/Basket.html',
            controller: 'BasketCtrl'
        })
        .when('/AccountInformation', {
            templateUrl: 'partial/AccountInformation.html',
            controller: 'AccountInformationCtrl'
        })
        .when('/Contact', {
            templateUrl: 'partial/Contact.html',
            controller: 'ContactCtrl'
        })
        .when('/FirstProofOfPurchuase', {
            templateUrl: 'partial/FirstProofOfPurchuase.html',
            controller: 'FirstProofOfPurchuaseCtrl'
        })
        .when('/SecondProofOfPurchuase', {
            templateUrl: 'partial/SecondProofOfPurchuase.html',
            controller: 'SecondProofOfPurchuaseCtrl'
        })
        .otherwise({
            redirectTo: '/'
        });;
});


app.run(['$rootScope', '$location', 'Auth', function($rootScope, $location, Auth) {
    $rootScope.$on('$routeChangeStart', function(event) {
        console.log($location.path());

        if ($location.path() === '/Login' ||
            $location.path() === '/Contact' ||
            $location.path() === '/Register' ||
            $location.path() === '/Category' ||
            $location.path() === '/Main') {

            $location.path($location.path());
        } else if ($location.path().indexOf('') > -1) {
            if (!Auth.isLoggedIn()) {
                event.preventDefault();
                $location.path('Login')
                    .search({
                        errorParam: 'Please login correctly'
                    });
            }
        }
    });
}]);




app.factory('Auth', ['$location', '$route', function($location, $route) {
    var user;

    return {
        setUser: function(aUser) {
            user = aUser;
            $location.path('');
        },
        isLoggedIn: function() {
            return (user) ? user : false;
        },
        getUser: function() {
            return user;
        },
        logout: function() {
            $route.reload();
            window.location.reload();
        }
    }
}]);

app.directive("entering", function() {
    return function(scope, element, attrs) {
        element.bind("mouseenter", function() {
            scope.fun.start();
        })
    }
});


