app.service('BasketService', function() {
    var basket = [];
    this.addToBasket = function(data) {
        basket.push(data);
    };
    this.removeFrmBasket = function(index) {
        basket = basket.filter(function(i) {
            return i != basket[index]
        });
    };
    this.getBasket = function() {
        return basket;
    };
    this.getTotalPrice = function() {
        var totalPrice = 0;
        basket.forEach(function(item) {
            totalPrice += parseFloat(item.price);
        });
        return totalPrice;
    };
});

